func TestIntelliBedZipFileWithBothZipValidationFunctions(t *testing.T) {
	width, height, _ := getHTMLZipDimensionsFromMetaTag(intelliBedZipFile)
	if width == 0 && height == 0 {
		width, height, _ = getHTMLZipDimensionsGoogleWebDesigner(intelliBedZipFile)
	}
	assert.Equal(t, 336, width)
	assert.Equal(t, 280, height)
}

func TestGetHTMLZipDimensionsGoogleWebDesignerReturnsZerosWhenHTMLWasNotMadeWithGoogleWebDesigner(t *testing.T) {
	width, height, _ := getHTMLZipDimensionsGoogleWebDesigner(nonGoogleWebDesignerHTMLZipFile)
	assert.Equal(t, 0, width)
	assert.Equal(t, 0, height)
}

func TestGetHTMLZipDimensionsGoogleWebDesignerReturnValidWhenHTMLIsFromGoogleWebDesigner(t *testing.T) {
	width, height, _ := getHTMLZipDimensionsGoogleWebDesigner(googleWebDesginerHTMlZipFile)
	assert.Equal(t, 300, width)
	assert.Equal(t, 600, height)

	width2, height2, _ := getHTMLZipDimensionsGoogleWebDesigner(googleWebDesignerHTMLZipFile2)
	assert.Equal(t, 550, width2)
	assert.Equal(t, 400, height2)
}

